import React, { useState } from 'react';
import chartStyle from './chart-home.module.scss';
import { Line } from 'react-chartjs-2';

const ChartHome = () => {
    const [Data, setData] = useState({
        labels: ['ינואר', 'פבואר', 'מרץ', 'אפריל', 'מאי', 'יוני', 'יולי', 'אוגוסט', 'ספטמבר', 'אוקטובר', 'נובמבר', 'דצמבר'],
        datasets: [
            {
                label: 'לקוחות',
                backgroundColor: "rgba(116, 103, 239, 0.39)",
                data: [20, 5, 1, 10, 32, 2, 12, 6, 12, 41, 34, 56]
            }
        ]
    })
    return (
        <div className={chartStyle.Chart}>
            <Line
                options={{
                    responsive: true, maintainAspectRatio: false,
                    scales: {
                        xAxes: [{
                            gridLines: {
                                color: "rgba(0, 0, 0, 0)",
                            }
                        }]
                    }
                }}
                data={Data}
                height={300}
                width={300}

            />
        </div>
    )
}

export default ChartHome;
